import React from "react";
import moviesData from "./moviesData";

// Componente MovieList que muestra una lista de películas
const MovieList = () => {
    return (
        <div>
            <h2>Lista de Películas</h2>
            <ul>
                {moviesData.map((movie, index) => (
                    <li key={index}>
                        <img src={movie.poster} alt={movie.title} />
                        <div>
                            <h3>{movie.title}</h3>
                            <p>Personas: {movie.people.join(", ")}</p>
                            <iframe
                                width="560"
                                height="315"
                                src={`https://www.youtube.com/embed/${movie.youtubeId}`}
                                title={movie.title}
                                allowFullScreen
                            ></iframe>
                        </div>
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default MovieList;
